export default function Header (){
return(
  <>
<Container>
<Navbar className = {'headBody'} collapseOnSelect expand={'md'}>
    <Container>
        <Navbar.Brand href='/' >

        </Navbar.Brand>
            <Nav className={'m-auto'}>
                <Nav.Link className={'link'} href={'/'}>

                </Nav.Link>

                <Nav.Link className={'link'} href={'/Blog'}>

                </Nav.Link>
            </Nav>

    </Container>
</Navbar>
</Container>
</>
)
}
